import TbInputControl from "../UI/TbInputControl";

const CreateNewUser = ()=>{
    return(
        <>
            <h3>Create New User</h3>
            <div className="jumbotron ">
                <TbInputControl Name={'User Name'} inutType={'email'} id={200} />
                <TbInputControl Name={'User Name'} inutType={'text'} id={200} />
                <TbInputControl Name={'User Name'} inutType={'radio'} id={200} />

            </div>

        </>
    )
}

export default CreateNewUser;
